                WriteLiteral(@"ss=""tab-pane fade show active"" id=""pills-home"" role=""tabpanel"" aria-labelledby=""pills-home-tab"">
                                    <h3 class=""tab-title"">Ürün Açıklaması</h3>
                                    <p>
                                        Son Akşam Yemeği (Cenacolo), Milano’da Santa-Maria delle-Grazie’nin yemek salonunda.  Burası  İtalya'nın kuzeyinde, Milano şehrinde yer alan mimarlar Donato Bramante ile Guiniforte Solari’nin inşa ettikleri ve 1497’de açılmış bir kilise ve Dominikan manastırı. 1980 yılında UNESCO tarafından Dünya Mirası olarak ilan edildiğini de ekleyelim. İşte bu kilisede bulunan ve 1495 -1498 yılları arasında yapılan 9.10x4.20 m. ölçüsündeki bu freskin her tarafı aradan yarım yüzyıl geçmeden çatlamış, boyaları dökülmüş, beceriksiz ellerin onarımlarıyla eser büsbütün berbat bir duruma düşmüştür. O dönemde normalde freskler ıslak sıva üzerine boyanırdı ama Leonardo di ser Piero da Vinci (1452-1519) çeşitli nedenlerden dolayı bu geleneksel tekniği reddetti. Bu tekniği redd");
                WriteLiteral(@"etmesinin temel nedeni daha canlı renkler elde etmeyi istemesiydi.
                                    </p>
                                    <p>
                                        İkinci dünya savaşında ağır bombardımana tutulan Milano şehrinde Santa Maria Della Grazie kilisesi de bombalardan nasibini almıştı. Fakat neyse ki, yöre halkı savaşın acımasız koşullarında tarih ve sanat bilinciyle, eseri kum torbaları ile kapatıp korumayı başarabildiler. Yine de bombardıman esere ciddi hasar verdi.
                                    </p>
                                    <p>
                                        Da Vinci her ayrıntıyı mükemmel bir şekilde çizebilmek için kendi tekniğini icat etti, taş üzerinde tempera boyalar* kullandı, neme karşı özel bir astar geliştirdi. Ancak bu tekniğin başarılı olduğu pek söylenemez. Daha 16. yüzyılın başlarında boya dökülmeye ve çürümeye başlamış, 50 yıl içerisinde ise Son Akşam Yemeği’nin eski ihtişamı bir harabeyi andırmıştı. Yapılan restorasyon işlemler");
                WriteLiteral(@"i ise durumu daha da kötüleştirdi. 2. Dünya Savaşı sırasında gerçekleşen bombardıman eser üzerinde ciddi hasarlar bırakmıştı.  1980 yılında başlayan yenileme işlemi tam yirmi sene sürmüştür.
                                    </p>
                                    <p>
                                        Son Akşam Yemeği’nin konusu İncil’dendir. İncil’de şöyle der: ‘’Hamursuzun birinci gününde havariler sofranın nerede hazırlanacağını sordular. (Hamursuz: Yahudilerin 7 Nisan ile 13 Nisan tarihlerinde mayasız ekmek yediği bir ibadettir. 14 Nisan akşamı ise bir kuzu kesilir ve bu kuzu sabah şafak vakti yenir).” İsa yemekteyken şöyle der; ‘’Size derim ki, içinizden biri beni ele verecek.’’ Çok üzülen havariler telaşlanarak ‘’Ben miyim?’’ diye sormaya başlarlar. İsa şöyle cevap verir; ‘’Benimle birlikte sahana ekmek banan biri, bana ihanet edecek. Tanrı’nın oğlu alnına yazıldığı için gidiyor, ama Tanrı’nın Oğlu’na ihanet edenin başına gelecekleri düşünün! Hiç doğmasaydı onun için daha iyi olurdu.’’ İşte ");
                WriteLiteral(@"o zaman Yahuda İskariot ‘’Ben miyim ?’’ dediğinde İsa, ‘’Ağzınla söyledin’’ der. Devamında İsa onlara yemek yiyecekleri evi gösterir ve akşam olduğunda hepsi evde toplanır. Bu sırada on iki havariden biri olan Yahuda İskariot İsa’yı öldürmek isteyen başrahiplere, otuz gümüş karşılığında Hz.İsa’yı ele vereceğine dair söz vermiştir. Bu yüzden de uygun bir fırsat kollamıştır.
                                    </p>
                                    <p>
                                        Resimde Mesih ve  On İki Havarisi vardır. Havarilerinden biri ona ihanet edilmek üzere olunduğunu kulağına fısıldamaktadır. Da Vinci’nin bu eseri bitirmesi üç yıl alır ve son yemekte yaşanan dramı olağanüstü bir şekilde yakalar. Gökyüzünde bir yerdeymiş izlenimi veren salon ve yemekte hazır bulananların ifadeleri, duruşları sanki yaşanılacak olanları sezinletmektedir. Bu arada bilindiği üzere, Da Vinci kutsal mekânlar için birçok eser tasarlamıştır, Milano Katedrali için bir kubbe tasarımı öne çıkanlardan biridir.
   ");
                WriteLiteral(@"                                 </p>
                                    <p>
                                        Son Akşam Yemeği tablosu İsa’nın yakalanıp çarmıha gerilmeden önceki son akşam yemeği olarak bilinmektedir. Ancak etrafına toplanan havarilerin pozisyonları ve vücut dilleri durumun bu kadar basit olmadığını bize göstermekte.  Havarilerin ona ihanet edeceği ya da diğer bir deyişle onu yalnız bırakacağı sezilmektedir. Masada yiyecek olarak şarap ve ekmeğin bulunması da bunun yeniden doğuşla sonuçlanacağını simgelemektedir.
                                    </p>
                                    <p>
                                        Eseri incelediğimizde uzun bir yemek masasının önünde, 12 Havariyi İsa’nın sağında ve solunda üçer kişilik kümeler halinde görüyoruz. Mesih: “Hakikatte size derim ki sizden biri beni ele verecektir” demiş ve bu söz havarilerin üzerinde derin bir tesir uyandırmıştır. Bu tesirin yankıları soldan sağa doğru kopan hareketlerde, çehrelerin aldığı değişik if");
                WriteLiteral(@"adelerde görülüyor. Her havari mizacına göre başka bir tavır takınmıştır. Biri “Ey Mesih o hain ben miyim?” der gibi, ellerini göğsünde birleştirmiş, bir başkası iyi işitip işitmediğini sormak için yanındakine eğiliyor, bazıları İsa’nın sözünü birbirine şüphe ve korku ile tekrarlayıp duruyorlar. Nihayet Yahuda, Ressam Giotto’nun çelimsiz, küçük Yahudisi gibi acınacak bir halde süklüm püklüm uzaklaşacağı yerde, masanın etrafında oturanlara derin bir nazar fırlatıyor, İsa’nın ağzından çıkan sözün anlaşılıp anlaşılmadığını, kendisi için tehlike olup olmadığını anlamaya çalışıyor. Bir yıldırım gibi sofraya düşen söz, bazı çehrelerde isyana, bazı çehrelerde tevekküle ve hüzne, bazılarındaysa şüphe ve korkuya dönüvermiştir. Eserde büyük bir değişiklik içinde bir organik birlik göze çarpmaktadır. Özetle muhteşem bir karakter tahlili.
