                                </div>
                                <div class=""tab-pane fade"" id=""pills-profile"" role=""tabpanel"" aria-lab");
                WriteLiteral(@"elledby=""pills-profile-tab"">
                                    <h3 class=""tab-title"">Sanatçının Hayatı</h3>
                                    <p>
                                        Leonardo di ser Piero da Vinci 15 Nisan 1452’de Floransa’da doğdu. Avrupa’daki modern isimlendirme kurallarından önce adı Leonardo di ser Piero da Vinci’dir. Bu adın manası, Vinci’li üstad Piero’nun oğlu Leonardo’dur.
                                    </p>
                                    <p>
                                        Da Vinci, ilk öğrenim yıllarında aritmetik ve geometride öğretmenlerinin sorduğu sorulara şaşırtıcı cevaplar verecek kadar iyiydi. Bu yeteneği ile küçük yaşlarda da dikkat çekiyordu. Çocukluk yıllarında yapmaktan en keyif aldığı iş resim çizmekti. Yalnızca resim çizmiyor, aynı anda lir de çalıyordu. Babası ondaki yetenekleri fark edince, onu Floransa’nın en önemli atölyelerinden birine çırak olarak verdi.
                                    </p>
                                    <");
                WriteLiteral(@"p>
                                        14 yaşına kadar Vinci’de yaşadı büyükanne ve büyükbabasının yanında yaşadı. İkisi de ard arda ölünce Floransa’ya gitti. O donemde evlilik dışı çocukların üniversiteye gitmesi yasaktı ve maalesef Leonardo da babasının evlilik dışı bir ilişki sonucu dünyaya gelmiş bir çocuktu. Bu yüzden üniversitede okuma imkanı bulamadı.
                                    </p>
                                    <p>
                                        Dönemin ünlü heykeltıraşı Andrea del Verrocchio, Leonardo’nun resimlerinden etkilenip onu çırak olarak kabul etti. Burada yalnızca Verrocchio ile değil, Lorenzo di Credi ve Pietro Perugino gibi önemli sanatçılarla da çalışma fırsatı buldu. Leonardo lir çalmayı burada öğrenmişti.
                                    </p>
                                    <p>
                                        Da Vinci, 1482 senesinde Floransa’yı terk etti. Dünyaca ünlü, dünya tarihinin en olağanüstü iş başvurusu olarak kabul edilen mektu");
                WriteLiteral(@"bunu bu dönemde Milano Dükü Sforza için yazdı. Bu olağanüstü mektup sonucunda 17 yıl boyunca Milano Dükü için çalıştı. Dük için yalnızca resim veya heykel yapmadı, aynı zamanda bina, makine ve silah tasarımları yaptı.
                                    </p>
                                    <p>
                                        1485-1490 seneleri arasında doğa, mekanik, geometri, uçan makineler, kilise, kale ve kanal yapımı gibi alanlarda faaliyet gösterdi. Tüm bunların yanı sıra anatomi çalışmaları yaptı ve talebeler yetiştirdi.
                                    </p>
                                    <p>
                                        1499 yılında Milano’yu terk etti, 16 yıl boyunca İtalya’da seyahat etti. İnsanlık tarihinin en önemli resimlerinden biri olan Mona Lisa’yı bu dönemde yapmaya başladı. 1503 yılında yapmaya başladığı tahmin edilen Mona Lisa tablosunu resmi tamamladıktan sonra bile yanından hiç ayırmamış, tüm seyahatlerinde yanında götürmüştür.
                        ");
                WriteLiteral(@"            </p>
                                    <p>
                                        Leonardo da Vinci, 1513-16 seneleri arasında Roma’da yaşadı ve Papa için birçok projede yer aldı. Bu dönemde anatomi ve fizyoloji alanlarında çalışmaya devam etti. Fakat Papa, da Vinci’nin kadavralar üzerinde çalışmasını yasakladı.
                                    </p>
                                    <p>
                                        1516 yılında Kral 1. Francis’ten Fransa’nın baş ressam, mühendis ve mimar olmak için davet aldı. Bu davete icabet eden da Vinci, Amboise yakınlarındaki Kraliyet Sarayı’nın hemen yanında kendisi için hazırlanan konağa yerleşti.
                                    </p>
                                    <p>
                                        Anatomi çalışmaları, da Vinci’nin giderek daha çok üzerine yoğunlaştığı bir konu haline gelmişti. İnsan organizmasına, çalışma kurallarını merak ettiği mükemmel bir makine olarak yaklaşmıştır.
                        ");
                WriteLiteral(@"            </p>
                                    <p>
                                        Gördüğü, gözlemlediği her şeyi çizerek açığa kavuşturuyordu. Yaptığı ayrıntılı çizimlerle anatominin detaylarını ortaya çıkarıyordu. Çizimleri, bazı ufak yanlışlıklara rağmen son derece nettir. Meşhur anne karnındaki bebek çizimi için inekleri incelemiş ve elde ettiği sonuçları insanlara uyarlamıştır. Papa insan anatomisi üzerine çalışmasını yasakladıktan sonra ise dolaşım sistemi üzerine yaptığı araştırmasını sığır kalpleriyle çalışarak devam ettirmiştir.
                                    </p>
                                    <p>
                                        Leonardo da Vinci, 2 Mayıs 1519’da 67 yaşındayken Ambois’teki evinde yaşamını yitirdi. Kralın kollarında can verdiğine dair rivayetler vardır.
                                    </p>
                                    <p>
                                        Son sözleri ise “Çalışmalarım olması gereken kaliteye erişmediği için Tan");
                WriteLiteral(@"rıyı ve insanlığı gücendirdim.” olmuştur. Ambois’teki Saint Florentin Kilisesi’nde toprağa verilmiştir.
                                    </p>
                                </div>

                            </div>
